import "./App.scss";
import Provider from "./context/DataContext";
import SearchPage from "./pages/SearchPage";

function App() {
  const [userValue, setUserValue] = useState();
  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  useEffect(() => {
    getData();
  }, []);
  const dataProps = {};

  return (
    <Provider {...dataProps}>
      <div className="App">
        <SearchPage />
      </div>
    </Provider>
  );
}

export default App;
